      string: '{"key":"38b4c89f-584c-41bb-bd8f-cd1def33e92f","installationKey":"4346b227-ca68-4d54-8a77-909148492e0b","publishingOrganizationKey":"b8323864-602a-4a7d-9127-bb903054e97d","doi":"10.15468/kllkyl","version":"92.421","external":false,"numConstituents":0,"type":"OCCURRENCE","subtype":"OBSERVATION","title":"Artportalen","description":"<p>Artportalen
        is a website for reporting and retrieving information on observations of Sweden’s
        plants, animals and fungi. Observations are entered individually or into several
        thousand subsets/projects (some of which are individually searchable) by individuals
        and NGOs (95% of data), by public authorities or agencies, and by corporate
        enterprises. An observation may include not only the species identity, reporter
        identity, location and date but additional information such as habitat type
        and weather can also be entered.</p><p>Access to ca. 93% of all data contained
        in the original dataset is unrestricted, the remainder is data for sensitive
        species as classified by the national checklist of sensitive species managed
        by SLU Swedish Species Information Centre. This dataset contains the open
        data. The restricted data can be retrieved from the original dataset given
        permission and requiring special log-in credentials.</p><p>Artportalen covers
        more than 40 000 Swedish species out of the 62 600 recorded in total from
        the country, including plants (18% of data representing flowering plants and
        mosses), vertebrates (0.2% fishes and herptiles, 70% birds, 0.4% mammals),
        invertebrates (8%) and fungi (4%). 81% of all data represent observations
        made from 2001-present, and almost all remaining observations refer to the
        period 1951-2000.</p><p>Taxa, nomenclature and hierarchy are sourced from
        Dyntaxa – the Swedish taxonomic database. Artportalen is developed and operated
        by the SLU Swedish Species Information Centre (SLU Artdatabanken) at the Swedish
        University of Agricultural Sciences, on behalf of the Swedish Environmental
        Protection Agency.</p>","language":"eng","homepage":"https://www.artportalen.se/","citation":{"text":"SLU
